import React from 'react';

function Menu() {
  return (
    <div>
      <h2>Menu Page</h2>
      <div>
        <h3>Dishes:</h3>
        <ul>
          <li>1. Spaghetti Carbonara</li>
          <li>2. Grilled Salmon</li>
          <li>3. Margherita Pizza</li>
          <li>4. Chicken Alfredo</li>
          <li>5. Caesar Salad</li>
        </ul>
      </div>
    </div>
  );
}

export default Menu;
